import { Dispatch, SetStateAction, useEffect, useState } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import { Timer, StartButton, Box, Container, MoveOn } from "./Common";
import Header from "./Header";
import QuestionPrompt from "./QuestionPrompt";
import SummaryPrompt from "./SummaryPrompt";
import TimerBar from "./TimerBar";
import { Case, Question, Station, Station_new } from "./types";

type SummaryProps = {
    station: Station_new;
    updateStation: Dispatch<SetStateAction<Station_new>>
}

const Summary = (props: SummaryProps) => {

    return (
        <Container>

            <Header
                timedHeader = { false }
                percentage = { 100 }
                briefPrompt = { props.station.brief.prompt }
                title = { "Station One" }
            />

            <br></br>

            <Box style = {{ textAlign: "center" }}>

                <SummaryPrompt  />

                <br/>

                <Link to = "/OSCE/Station/Review0">
                    <Start>
                        Start Review
                    </Start>
                </Link>

            </Box>

        </Container>
    )

}

export default Summary;

const Start = styled.div`
    background-color: grey;
    border: 2px solid grey;
    border-radius: 5px;
    margin: 0 auto; 
    padding: 1% 0;
    &:hover {
        cursor: pointer;
        border: 2px solid #FAD000;
        color: #FAD000;
    }
`
